		this.addEventListener("tick", presiging.bind(this));
		function presiging() {
			if (prestige[1] < prestige[0]) {
				prestige[0] = Math.max(1, prestige[1]);
			}
			if (prestige[0] < 1) {
				prestige[0] = 1;
			}
			
			
			if (allmoney.log(1000).times(0.01).plus(1).lt(1.2)) {
				prestige[1] = allmoney.log(1000).times(0.01).plus(0.99);
			}
			else if (allmoney.log(1000000).times(0.01).plus(1.1).lt(1.3)) {
				prestige[1] = allmoney.log(1000000).times(0.01).plus(1.09);
			}
			else if (allmoney.log(1000000000).times(0.01).plus(1.1+2/30).lt(1.4)) {
				prestige[1] = allmoney.log(1000000000).times(0.01).plus(1.09+2/30);
			}
			else if (allmoney.log(1e12).times(0.01).plus(1.1+3.75/30).lt(1.6)) {
				prestige[1] = allmoney.log(1e12).times(0.01).plus(1.09+3.75/30);
			}
			else if (allmoney.log(1e18).times(0.01).plus(1.1+7.5/30).lt(2)) {
				prestige[1] = allmoney.log(1e18).times(0.01).plus(1.09+7.5/30);
			}
			else {
				prestige[1] = allmoney.log(1e36).sqrt().sqrt().times(0.01).plus(1.976);
			}
			
			prestige[3] = nd(2.6).pow(allmoney.div(1000000000).log(1000));
			
			//softcap
			if (prestige[3].gt("1e50")) {
				prestige[3] = prestige[3].div("1e50").pow(0.25).times("1e50");
			}	
			//softcap 2
			if (prestige[3].gt("1e1000")) {
				prestige[3] = prestige[3].div("1e1000").pow(0.1).times("1e1000");
			}
			
			prestige[3] = (prestige[3]).sub(1).times(promi[2]).plus(1)
			
			prestige[3] = Decimal.max(nd(1), prestige[3]);
			
			if ((prestige[1] > prestige[0]) || (prestige[3].div(prestige[2])).gt(1.0001)) {
				this.upprest.prest.visible = true;
				this.prrem.visible = true;
				this.upprest.prest.xpnow.text = "Power now: " + Math.round(prestige[0]*1000)/1000;
				this.upprest.prest.xpar.text = "Power aft. pr.: " + Math.round(prestige[1]*1000)/1000;
				this.upprest.prest.pmnow.text = "Prest. Mult x" + format_short(prestige[2]);
				this.upprest.prest.pmar.text = "PM aft. pr. x" + format_short(prestige[3]);
			}
			else {
				this.upprest.prest.visible = false;
				this.prrem.visible = false;
			}
			this.upprest.prest.clickP.text = clicksPrestige + " clicks to Prestige!";
			
		}
		
